import React, { Component } from 'react'
import axios from 'axios'
import { Link } from "react-router-dom";
import { Grid } from '@material-ui/core';
import './css/Home.css'

export default class Servicios extends Component {
    state = {
        reg: []
    }

    componentDidMount() {
        axios.get('http://localhost:3001/regiones')
            .then(res => {
                const reg = res.data;
                this.setState({ reg });
            })
    }

    render() {
        const { reg } = this.state

        return (
            <div className="contenedoPronGeneral">
                {reg.map((item) => {
                    return (
                        <div key={item.region_id} >
                            <Link to={"/region/" + item.region_id} >
                                <Use
                                    name={item.region}
                                />
                            </Link>
                        </div>
                    )
                })}

                
            </div>
        )
    }
}

function Use(props) {

    const styles = [
        {
            text: "hola1",
            css: {
                left: '142px',
                top: '101px'
            }
        },
        {
            text: "hola2",
            css: {
                left: '146px',
                top: '152px'
            }
        },
    ]

    return (
        <div>
            {styles.map((item,i) => {

                    return (
                        <div key={i}>
                            <h1>{ this.props.name}
                                {item.text}
                            </h1>
                        </div>
                    )
            })}
        </div>
    );
}
